import Nav from './components/Nav';
import Content from './components/Content';
import Card from './components/Card';

import Swimmer from './images/image 12.png'

function App() {
  return (
    <div>
     <Nav />
     <Content />
     <Card 
       img={Swimmer}
       state = 'SOLD OUT'
     />
     <Card />
     <Card />
    </div>
  );
}

export default App;
